import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import styles from "./styles/App.module.scss";

ReactDOM.render(
  <body className={styles.root}>
    <App />
  </body>,
  document.getElementById("root")
);
